import React, { createContext, useEffect, useRef, useState } from "react";
import { Container } from "react-bootstrap";
import Switch from "react-bootstrap/esm/Switch";
import { Link, Route, useRouteMatch } from "react-router-dom";
import useAuth from "../../auth/useAuth";
import WelcomeAccountPage from "./WelcomeAccountPage";
import styles from "./AccountPage.module.css";
import CitaAccountPage from "./CitaAccountPage";

const NavLinksAccountPage = () => {
  let { path, url } = useRouteMatch();
  const { user } = useAuth();
  const userRef = useRef(user);

  const refreshSidebar = () => {
    console.log(user);
  };

  useEffect(() => {
    refreshSidebar();
    return () => {
      refreshSidebar();
    };
  }, []);

  return (
    <>
      <li className={styles.navText}>
        <Link to={`${url}/citas`} className={styles.sidebarOption}>
          <box-icon type="solid" name="home"></box-icon>
          <span className={styles.sidebarSpan}>Inicio</span>
        </Link>
      </li>
      <li className={styles.navText}>
        <Link to={`${url}/citas`} className={styles.sidebarOption}>
          <box-icon name="plus-medical"></box-icon>
          <span className={styles.sidebarSpan}>Citas</span>
        </Link>
      </li>
      <li className={styles.navText}>
        <Link to={`${url}/pedidos`} className={styles.sidebarOption}>
          <box-icon name="cart" type="solid"></box-icon>
          <span className={styles.sidebarSpan}>Pedidos</span>
        </Link>
      </li>
      <li className={styles.navText}>
        <Link to={`${url}/pedidos`} className={styles.sidebarOption}>
          <box-icon type="solid" name="user"></box-icon>
          <span className={styles.sidebarSpan}>Cuenta</span>
        </Link>
      </li>
    </>
  );
};

export default NavLinksAccountPage;
